import styled from "styled-components";

export default function Main() {
  return (
    <Container>
      <h1>Hello</h1>
    </Container>
  );
}

const Container = styled.div`
  box-sizing: border-box;
  font-family: "Lexend Deca";
  height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;
